// props ->pass the information from one component to 
           //another compoennt ,{},immutable

//destructuring --> multiline props to make singal line props
// props-types -->Validate the data types 
// npm install prop-types

import React from "react"
import PropTypes from "prop-types"
class App extends React.Component{
  render(){
    const {name,city,state,age}=this.props;
    return(
      <div>
        <p>Name:{name}</p>
        <p>City:{city}</p>
        <p>sate:{state}</p>
        <p>Age:{age}</p>

      </div>
    )
  }
}
// validating the data types
App.propTypes={
  name:PropTypes.string,
  city:PropTypes.string,
  state:PropTypes.string,
  age:PropTypes.number
}

App.defaultProps={
  name:48758,
  city:"Hosur",
  state:"Tamuil nadu",
  age:"47"
}

export default App;
